import React from "react";
impo
import "../styles/lead.css";
import "../styles/button.css";
import Chevron from "../images/chevdown1.png";
axios({
  method: "get",
  url: "downloadSamplePDF.php",
  responseType: "arraybuffer"
})
  .then((response) => {
    var link = document.createElement("a");
    link.href = window.URL.createObjectURL(
      new Blob([response.data], { type: "application/octet-stream" })
    );
    link.download = "name_of_file_with_extension";

    document.body.appendChild(link);

    link.click();
    setTimeout(function () {
      window.URL.revokeObjectURL(link);
    }, 200);
  })
  .catch((error) => {});
export default function Lead() {
  return (
    <div>
      <div id="lead">
        <div id="lead-content">
          <h1>Benedikt Lantsoght</h1>
          <h2>React Developer</h2>

          <a href="../images/cv.ben.nl.pdf" className="btn-rounded-white">
            Download Resume
          </a>
        </div>

        <div id="lead-overlay"></div>

        <div id="lead-down">
          <img src={Chevron} alt="chevron" className="scroll" />
          <h3></h3>
        </div>
      </div>
    </div>
  );
}
